class UmHymnsOmuenyoWiyako {
  static List<HymnsContent> list = [
    HymnsContent(id: 2999, position: 1, content: "A Suku, tu panduila onjivaluko\nYavakuopange\nWove va tambuiwa.\nTu ku sivaya; Wa va muisa ulamba.\nAleluya! Aleluya!", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_328, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3000, position: 2, content: "Ove, a Suku, wa va kolisile;\nWa va ohelele kolohali viosi\nHaive wa kala utanya wavo u kola.\nAleluya! Aleluya!", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_328, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3001, position: 3, content: "Eci ayonjo alua a tu sanga\nPamue ekavo lia tu tepuluka,\nNdo tu ivaluise ava va yula ale.\nAleluya! Aleluya!", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_328, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3002, position: 4, content: "Tu ihe itima vioku likapela,\nKoku upa ongangu yekolelo liavo.\nOco tu mole eyulo ndeli liavo.\nAleluya! Aleluya!", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_328, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3003, position: 5, content: "Tu ku panduila ongongela yetu,\nLava va iñila vepuyuko liove.\nMomo eyovo liavo halio lietu.\nAleluya! Aleluya!", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_328, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3004, position: 1, content: "Kesinya lina lia Yordão\nMbanjela longeva.\nKanana kana ka Suku,\nKua lunga utima. (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_329, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3005, position: 2, content: "Nda ndi ci sima ngandiwa\nLonjoi yokovailu.\nKu kuete ovapia ulamba,\nLolondui viesanju. (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_329, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3006, position: 3, content: "Ka ku li ofela yombambi\nKa ku li owule.\nKa ku li upongo lohali,\nLusumba lohele. (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_329, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3007, position: 4, content: "Nda ndonda kuna komunda\nMose a tumalele.\nNdomo a vanjele Kanana,\nNdi vanja kovailu. (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_329, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3008, position: 1, content: "Nda wa sumua lovakandu\nO yongola oku nyelela;\nNda wa kolela ku Yesu,\nEye oku kuatisa ciwa.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_330, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3009, content: "Enda love kuosi o kasi;\nEye oku kuatisa.\nKesanju loko kusumua,\nO linga Ekamba liove.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_330, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3010, position: 2, content: "Eci utima wa suvala,\nLocilemo colohele.\nNda wa kolela ku Yesu,\nOku lemba locisola.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_330, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3011, position: 3, content: "Nda wa sakalala ca lua,\nVilikiya Ñala Yesu.\nNda wo kolela ocili,\nKu nyelela vali sio.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_330, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3012, position: 4, content: "Eci omuenyo u sulila\nLoku yoka olui luokufa.\nYesu Kristu oku kuatisa,\nOku iñisa lesanju.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_330, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3013, position: 1, content: "Njongola ombembua yi supoka ndolui\nLu salalisa ofeka yekango.\nNdi lavokaila kuevi via'e ka vi pui,\nOmo voluali ñasi okasimbu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_331, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3014, position: 2, content: "Kulo okasimbu loku talavaya,\nToke ha mola onima yetavo.\nKulo okasimbo lika loku kula,\nNoke njolela laye elombolo.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_331, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3015, position: 3, content: "Kulo okasimbu kamue koku tapa\nKotundui tuaño tu kotuaka ño,\nNoke enyona liange ndi li imula,\nKono yovava ana omuenyo.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_331, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3016, position: 4, content: "Kulo okasimbu, ulela u womuenyo\nU pua vovela yange yetimba;\nPuãi sanjukila ohueli  eci yiya;\nNyiñila laye kuvala wokilu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_331, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3017, position: 1, content: "Kilu lieve upongo wa lua,\nLolohali longeva le,\nPuãi kilu esanju lika.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_332, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3018, content: "Tu imbi olopandu\nPandu! Pandu! Pandu!\nMomo tu ka mola\nEsanju li tumãla hũ.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_332, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3019, position: 2, content: "Kilu lieve esumuo lia lua\nLi tu nyika nyika ño,\nPuãi kilu esanju lika.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_332, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3020, position: 3, content: "Kilu lieve ekavo lia lua\nLepuyuko liocili sio,\nPuãi kilu esanju lika.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_332, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3021, position: 4, content: "Kilu lieve tua sakalala,\nLolohele ka vi pui mbu,\nPuãi kilu esanju lika.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_332, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3022, position: 5, content: "Ava vosi va sole Yesu,\nLoku tava Kondaka ya'e,\nVa mola esanju liaco.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_332, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3023, position: 1, content: "Tumbangiyi Ñala Yesu,\nPanduli ohenda ya'e.\nKimbo liaye liokovailu,\nTu ka kala kumue la'e.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_333, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3024, content: "Eci tu pitilako,\nTu ka kala lesanju li enda hũ.\nTu ka mola Yesu;\nTu ka sambiliya onduko ya'e.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_333, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3025, position: 2, content: "Tulongende kilu lieve,\nOvitangi ka vipui.\nPuãi ungende eci u pua\nKa tu kavi vali mbu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_333, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3026, position: 3, content: "Tu amamiko, avakuetu,\nOku kuama ño lutõi.\nNda tu u vumba kilu lieve\nTu ka mola ulamba wa'e.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_333, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3027, position: 4, content: "Tu lungili onima yiwa,\nTu yi sanga kimbo lia'e.\nNdopo va yulula ombundi,\nVa tu iñisa kuwa wa'e.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_333, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3028, position: 1, content: "Ku li oluali lua piãla.\nKovailu. Kovailu.\nAkandu kuenda asumuo a pua,\nKovailu. Kovailu.\nKu kasi Suku Utungi.\nKu kasi Yesu Onjovoli.\nKuenda Espiritu Uyelisi,\nKovailu. Kovailu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_334, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3029, position: 2, content: "Suku o ngecela akandu.\nMitila. Mitila.\nKokuaye ndi litumbika.\nMitila. Mitila.\nYesu wa noluila onjila,\nHaeye ombundi anjikuila.\nOmo a sola wa fila.\nMitila. Mitila.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_334, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3030, position: 3, content: "Esumuo li ka fulila.\nKesanju. Kesanju.\nOhali ndi yi tulila.\nKesanju. Kesanju.\nHa yeva isungo via fina.\nUlamba waye ndu mola.\nSangavo elau ka li pui mbu,\nKesanju. Kesanju.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_334, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3031, position: 1, content: "Kimbo lina liokovailu\nKu li ulamba wa piãla.\nUwa waco ka wimuha,\nMomo uteke ka ku li mbu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_335, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3032, content: "Suku o puenya asuẽlela,\nKa ku kala vali okufa.\nKa va tendi vali alima,\nMomo uteke ka ku li mbu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_335, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3033, position: 2, content: "Olombundi vi ñañala\nKimbo liaco liulamba.\nOkololo yalio yulu,\nKuenda uteke ka ku li mbu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_335, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3034, position: 3, content: "Ka va yila olombundi\nKimbo liaco liulamba.\nKa mu iñila cimue civi,\nKuenda uteke ka ku li mbu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_335, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3035, position: 4, content: "Ka ku kala vali ekumbi\nKimbo liaco liulamba.\nMomo Suku o li tuila,\nKuenda uteke ka ku li mbu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_335, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3036, position: 1, content: "Eci otembo yimuha,\nVu ka yevi olumbeta\nUtanya wokomele u ka tuila;\nVana va pinduka ale\nVa likongela kesinya;\nEci o nukula kovailu, Amilo.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_336, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3037, content: "Olonduko o vi tukula,\nOlonduko o vi tukula,\nLovevo va ku kovonga;\nEci o nukula kovailu, amilo.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_336, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3038, position: 2, content: "Kevilikiyo liaco\nVakua Yesu va votoka\nUlamba wepinduko va tambula;\nVakuetavo va likongela\nKovaso a Yesu;\nEci o nukula kovailu, Amilo.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_336, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3039, position: 3, content: "Kupange wa Suku akuetu\nVosi tu talavayi,\nOmbili ya velapo tu kuati;\nEci omuenyo wetu wa pua,\nUpange tua malusula\nOmangu yulamba tu ka tambula.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_336, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3040, position: 1, content: "Nda hẽ ci ka kala ndati\nOku mola Ukristu\nOcipala kocipala\nEci mitila kilu?", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_337, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3041, content: "Ha yolela, ha yolela,\nOku mola Ukristu.\nKa pa kambele osimbu,\nNdopo muele ndu mola.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_337, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3042, position: 2, content: "Ndaño siu lete ndopuilo,\nCi nateka etimba.\nHaimo li li oku iya eteke\nElindeti ho mola.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_337, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3043, position: 3, content: "Onjolela yi ka piãla\nEci mitila kokuaye.\nCosi ca mbalele ci pua,\nHa tumala kumue la'e.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_337, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3044, position: 4, content: "Kilu upongo si ko mola,\nNdaño oku lila mbu.\nLeci ci puiya ka ciko\nKocipaka ca Yesu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_337, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3045, position: 1, content: "Kuli imbo lia fina,\nKa mu li akandu.\nCosi ca viha,\nCosi ca viha\nKa ci iñilamo mbu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_338, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3046, position: 2, content: "A Yesu, hu lomba,\nOpopeli wange.\nNjelise utima.\nNjelise utima.\nKuenda oku mopela.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_338, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3047, position: 3, content: "Tunde kola yilo,\nNdinga Omolove.\nNyihe ongusu.\nNyihe ongusu\nMokola kokuove.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_338, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3048, position: 4, content: "Ndo ndave, a Suku\nTe mbuala via yela?\nOco ha mole,\nOco ha mole\nOfeka yesanju.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_338, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3049, position: 1, content: "Yesu eye onjila\nYo kilu komuenyo.\nO tu songuila. Tu u kuama\nTe kilu kulamba.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_339, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3050, content: "Ohali ka yiko. (2x)\nTu mola esanju lia piãla,\nOhali ka yiko.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_339, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3051, position: 2, content: "Ku Suku tu sanga\nOlonjo via fina.\nKu li U wa tu pongiyila\nOlonjo via fina.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_339, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3052, position: 3, content: "Iya o tu upilila\nTu kala kumue la'e.\nNdondaka yohuminyo yaye,\nTu kala kumue la'e.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_339, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3053, position: 1, content: "Imbili ovaso kesinya,\nKonele yolui luomuenyo\nVa tãi vakuanjelo yutima,\nOvitima, va yelisa pe.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_340, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3054, content: "Kesinya, kesinya\nImbili ovaso kesinya. (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_340, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3055, position: 2, content: "Vakuetavo vali kesinya\nOvitele va tulako ale;\nOvisungo viesanju va imbamba\nKonjo yavo kimbo lia Suku.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_340, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3056, position: 3, content: "Haiko Yesu ali kesinya\nLa vakuetu va puyukako.\nTu pãlali kofeka yesanju\nLoku tila upongo wetu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_340, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3057, position: 1, content: "Yesu, Onjovoli yetu iya.\nO tambula ava va yela kakandu.\nSoma yetu iya o tu viala.\nYesu, Onjovoli, iya.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_341, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3058, content: "Iya lulamba wa piãla enene.\nIya oku tu upilila.\nTu imbi oluiya ha lu yevala:\nYesu, Onjovoli, iya.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_341, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3059, position: 2, content: "Yesu eci eya o pindula\nVakuekolelo va fila kokua'e.\nKumosi lavo o tu tambula.\nYesu, Onjovoli, iya.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_341, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3060, position: 3, content: "Yesu eci eya imula ovita.\nO tumalisa ombembua ya lua.\nUpongo wetu o tu wimula.\nYesu, Onjovoli, iya.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_341, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3061, position: 4, content: "Wa likuminya hati, Njiya.\nLondaka yaco tu yi kolela,\nTu liyelisa ha tu endi ciwa.\nYesu, Onjovoli, iya.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_341, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3062, position: 1, content: "Yerusalãi ya Yehova\nYi kasi kovailu.\nEteke lipi mitila\nKokuayo lesanju? (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_342, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3063, position: 2, content: "Komunda yaye Siono\nYehova a tunga.\nKonele yolui luomuenyo\nKu kuete ombala yaye. (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_342, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3064, position: 3, content: "Ku li ono ya Daviti\nLutanya wa Suku.\nKu livo uti womuenyo\nU sakola omanu. (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_342, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3065, position: 4, content: "Kofeka yaco ya fina\nNdotembo yonjovo.\nKa ku li uvei pamue onjala\nCi vala ka ciko. (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_342, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3066, position: 1, content: "Itima viavakuesunga\nVi kasi peka lia Suku;\nUngende wavo wa pua;\nUpange wavo va mala.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_343, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3067, position: 2, content: "Vakuanumbi vati:\nVa ka nyoleha ño.\nPuãi vati, va iluka kokufa\nVa ilukila komuenyo.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_343, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3068, position: 3, content: "Unene wa Suku\nOwo u va lava lava;\nOmuenyo waye wa va wila;\nVa tumala ño hũ...", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_343, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3069, position: 4, content: "Ndeci ulu u nyikaiwa,\nHaico Suku a va seteka;\nHa va kanguka ocili;\nVa pua atondelo osi.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_343, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3070, position: 5, content: "Omuenyo wetu wa kulo\nWa soka ndonjoi yuteke,\nOngusu yetu yetimba\nYi takata ño lombili.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_343, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3071, position: 1, content: "Eteke limue mekela,\nIsungo vilo vimuha;\nMasula puãi lonjolela\nKombala yina yosoma.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_344, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3072, content: "Ha mola ocipala ca'e,\nHa sivaya eyovo lia'e.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_344, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3073, position: 2, content: "Eteke limue njivaluka,\nNda liya ndopo, nda noke;\nHaimo nda kuliha Yesu.\nWa sokiyila onjo kilu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_344, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3074, position: 3, content: "Eteke limue ekumbi\nLiomuenyo ulo liñila;\nÑala yange ho pandiya\nO ka muyuisa ocili.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_344, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3075, position: 4, content: "Eteke limue o njuluila\nEpito lina liokilu;\nOvela yange yi taima,\nOco nyiñile lesanju.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_344, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3076, position: 1, content: "Ku li ofeka ya fina enene\nLekolelo tu yi muila kilu;\nKuna Yesu a tu lalekele.\nOnjo wa tu pongiyilako.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_345, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3077, content: "Yoleli! Kua fina.\nKilu, eci tu liongolola. (2x)", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_345, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3078, position: 2, content: "Tu ka imbila ovisungo kilu,\nVina vimba va sumuluha;\nOko ka ku li vali esumuo\nTe lika esanju lienda ño hu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_345, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3079, position: 3, content: "Ku Yehova ukuacali kilu,\nEtu tu ecaeca olopandu;\nOmo a tu sanjuisa enene\nLesumuluho lienda ño hu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_345, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3080, position: 1, content: "Eteke limue Yesu iya\nEteke limue Yesu iya.\nOhali yosi yika imuha,\nEteke limue Yesu iya.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_346, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3081, content: "Eteke limue Yesu iya\nEteke liaco tu sanjuka,\nOmbilikiya ndu tambulula\nEteke limue Yesu iya.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_346, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3082, position: 2, content: "Eteke limue  Yesu iya\nEteke limue Yesu iya.\nUpongo wosi wupua pe,\nEteke limue Yesu iya.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_346, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3083, position: 3, content: "Eteke limue Yesu iya\nOtupilila ha tu sanjuka.\nAsumuo osi aka imuha,\nEteke limue Yesu iya.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_346, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3084, position: 1, content: "Kuli ono ka yi takata,\nYeca ocinyei cesunga.\nKo calo ca Yesu,\nKu tunda ovava omuenyo.\nOlui lua fina, luenda evando;\nAme ndi lu sole.\nÑale apa pa pita\nOvava aco.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_347, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3085, position: 2, content: "Valua va tu liangela,\nVa imbila ale kilu.\nLolohalupa viavo,\nVa imba isungo viafina\nPolui ka lu takata mbu,\nHa imbilapo isungo.\nPa imbilua ño hu isungo,\nKo Yerusalãi.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_347, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3086, position: 3, content: "Ovava opululu,\nNdocinyi anina\nHelie wa va yelisa?\nOsonde ya Yesu.\nLuenda evando, olui lua fina.\nHaico vo ombembua,\nVutima wange yilue mo.\nYilue ocili.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_347, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3087, position: 1, content: "Ndete ofeka yombembua yalua:\nOko ha kala hu la Yesu.\nKuli olonjo via fina enene,\nÑala Yesu a tu angiliyila.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_348, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3088, content: "Ha tumãla ño hu,\nKofeka yulamba wa piãla;\nHa tumãla ño hũ,\nKofeka yulamba wa piãla.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_348, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3089, position: 2, content: "Ha imbila kofeka yokilu\nOvisungo ku Ñala yange\nKa kuli esumuo ndaño evalo;\nHa kala lulamba wa piãla.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_348, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3090, content: "Ha imbilako isungo\nKofeka yulamba wa piãla.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_348, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3091, position: 3, content: "Oluali ndi lusiapo noke\nSiendi ku Yesu siufendela.\nKimbo lina la soma yange,\nElau lialua halilako hu.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_348, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3092, content: "Ha lilako hũ,\nKofeka yulamba wa piãla.", hymnsNumber: UmHymnsNumberSeeder.OMUENYO_WIYAKO_348, typeStanza: HymnsContentCode.CHOIR),


  ];
